import React, { Fragment } from "react";
import { connect } from "react-redux";

const Policy = ({ customer: { policyList } }) => {
  return (
    <ul className="list-group mt-4">
      {policyList.map((policy) => {
        return (
          <Fragment key={policy.policyNum}>
            <li className="list-group-item list-group-item-info">
              Policy Number
            </li>
            <li className="list-grou-item">{policy.policyNum}</li>
          </Fragment>
        );
      })}
      <li className="list-group-item list-group-item-info">Policy Number</li>
      <li className="list-group-item">{customer.firstName}</li>
    </ul>
  );
};

const mapStateToProps = (state) => ({
  policyList: state.customer.policyList,
});

export default connect(mapStateToProps)(Policy);
